import { details } from './details';
export const footer = {
  about: {
    title: 'about us',
    description:
      'Far far away, behind the word mountains, far from the countries Vokalia and Consonantia, there live the blind texts.',
    socials: ['facebook', 'twitter', 'instagram'],
  },
  info: {
    title: 'have a questions?',
    details: details,
  },
};
